FILMGOO Glass Window Film are all Original Design. We develop innovative, custom designed products and solutions—and so shape people's everyday lives. These films provide protection and are the perfect decorative accent for windows that require continued privacy.  Our window glass film is dedicated to bringing more comfort and daytime privacy into home.
Use Steps:
; 1. Measure the size of your window. Cut the film into proper size, approximately 1 inch larger;
; 2. Clean your window thoroughly, this film need install on pure clean and smooth glass;
; 3. Wet the window completely;
; 4. Peel off the backing protective film;
; 5. Post the film on the window glass carefully;
; 6.Squeeze out all the bubbles and water inside (can use a Plastic card to do it);
; 7. Dry off your window with a rag entirely, cut the excessive edge carefully. Paste edge carefully. Done.
Key Notice For Window Film:
1. If you want to remove it, simply peel the window film from any corner. It comes off cleanly without leaving residue
2. When not in use, the film must be replaced and stored on the original backing paper. The side of the film that touched the glass should face the glossy side of the backing paper
3. Our film does not apply to carved, over frosted or irregular glass 
Window Film ;A:
Q:Why there is bubbles inside?
A:Because the water is not cleaned out entirly. After you position the film, please smooth out the film with squeegee, make the air bubbles and water out completely
Q:Could this film be used for more than one times?
A:Yes, Totally Reusable, Fantastic Eco Choice No Residue left on the glass at all, ideal for rental places.
